import React, { Component } from "react";
import "./Wrapper.css";
import Search from "./components/Search/Search.js";
import Industry from "./components/Industry/Industry.js";
import DisplayResults from "./components/Display/Display.js";

class SearchResultContainer extends Component {
    state = {
        placesResults: []
    }
    // <div className="columns"><Industry/></div>
    // <div className="wrapper">{props.children}</div>;
    Yeet = (props) =>{
        <Search/>
        if (results.length === 0){
            <Industry/>
        } else {
            <DisplayResults results={props.results} />
        }
    };
    render () {
        return (
        <Yeet results={this.state.placesResults} />,
        document.getElementById("root")
        )
    }
}
export default SearchResultContainer;
